import React from "react";
import client from "../contentful";
import FoodPost from "../components/foodPost/index.js";

const Home = () => {
  const [posts, setPosts] = React.useState(null);

  React.useEffect(() => {
    client
      .getEntries({
        content_type: "food",
      })
      .then((entries) => {
        setPosts(entries.items);
      });
  }, []);

  // posts &&
  //   posts.map((post, i) => {
  //     return console.log(post);
  //   });

  posts.forEach((post) => {
    console.log(post);
  });
};

export default Home;
